//First run first grid
function buildFirstGrid() {

    let k = 0;

    for (let i = 0; i < gridHeight; i++) {
        for (let j = 0; j < gridWidth; j++) {
            buildRectangle(cardColor1,j,i,k);
            gridTracker[k] = 0;
            k++;
        }
    }
}

//This needs to be called a lot to make sure everything is updated properly (canvas, amirite?!)
function rebuildGrid() {

    let k = 0;

    for (let i = 0; i < gridHeight; i++) {
        for (let j = 0; j < gridWidth; j++) {
            switch (gridTracker[k]) {
                case 0:
                    buildRectangle(cardColor1,j,i,k);
                    break;
                case 1:
                    buildRectangle(cardColor2,j,i,k);
                    break;
                case 2:
                    buildRectangle(cardColor3,j,i,k);
                    break;
                case 3:
                    buildRectangle(cardColor4,j,i,k);
                    break;
                case 4:
                    buildRectangle(cardColor1,j,i,k);
                    gridTracker[k] = 0;
                    break;
            }
            k++;
        }
    }
}

//Fun with canvas! This was very difficult to nail... so proceed carefully.
function buildRectangle(myColor, j, i, k) {
    
    ctx.fillStyle = myColor;
    ctx.fillRect(j * (canvasWidth / gridWidth), i * (canvasHeight / gridHeight),(canvasWidth / gridWidth) - borderSpace,(canvasHeight / gridHeight) - borderSpace);
    ctx.strokeStyle = myColor;
    
    if(playMode==="words") {
        ctx.font = "small-caps bold " + fontSize + "px Arial";
        ctx.fillStyle = fontColor;

        ctx.fillText(wordList[k], j * (canvasWidth / gridWidth) + borderSpace, (i * (canvasHeight / gridHeight)) + (canvasHeight / gridHeight / 2 + 5));
    } else if (playMode==="icons") {
        let image = new Image();
        console.log("grid height - " + gridHeight + "  grid width - " + gridWidth);
        image.onload = function () {
            let tempNum = gridWidth;
            
            if(gridHeight>gridWidth){
                tempNum = gridHeight;
            }

            let tempWidth = (canvasWidth / tempNum)/3;
            let tempHeight = (canvasWidth / tempNum)/3;

            ctx.fillStyle = "#642";

            ctx.drawImage(image, j * (canvasWidth / gridWidth) + ((canvasWidth / gridWidth)/2 - (((canvasWidth / tempNum)/3)/2)), (i * (canvasHeight / gridHeight)), (canvasWidth / tempNum)/3, (canvasWidth / tempNum)/3);
        };
        image.src = "icons/" + iconWordList[k];
    }
}

